import VkIcon from '../../../assets/icons/VK.svg';
import OkIcon from '../../../assets/icons/Ok.svg';
import TgIcon from '../../../assets/icons/TG.svg';
import cls from './ShareComponent.module.scss';
import { VKShareButton, OKShareButton, TelegramShareButton } from 'react-share';

export const ShareComponent = () => {
  return (
    <div>
      <div className={cls.shareText}>Поделиться</div>
      <div className={cls.socialIcons}>
        <VKShareButton url="https://pav.studio/">
          <VkIcon />
        </VKShareButton>
        <OKShareButton url="https://pav.studio/">
          <OkIcon />
        </OKShareButton>
        <TelegramShareButton url="https://pav.studio/">
          <TgIcon />
        </TelegramShareButton>
      </div>
    </div>
  );
};
